import { memo } from 'react';
import { Dustbin } from './Dustbin';
import MonsterCard from '../monsterCard/MonsterCard'
import { Box } from './Box';
const Board = memo(function Container() {
    return (<div>
        <div style={{ overflow: 'hidden', clear: 'both' }}>
            <Dustbin />
        </div>
        <div style={{ overflow: 'hidden', clear: 'both' }}>
            <Box name="Test 1" />
            <Box name="Test 2" />
            <Box name="Test 3" />
            <Box name="Test 4">
                <MonsterCard
                    cardName={'test'}
                    cardImage={'https://omiinaya.sirv.com/Images/card_game/babydragon.jpg'}
                    cardRarity={['x']}
                    cardMonster={'[dragon]'}
                    cardDesc={'test'}
                    cardAtk={1}
                    cardDef={1}
                />
            </Box>
        </div>

    </div>);
});

export default Board
